import "./Weather.css";

export default function Weather() {
    return (
        <div className="Weather">
           <h1>Lisbon</h1>
           <ul>
               <li>
                   Thursday 22:00
               </li>
               <li>
                   Raining
               </li>
           </ul>

            </div>
    )
}
